import React from 'react';


class WeatherContainer extends React.Component {
    render() {
        return (
            <div className="weather-container">
                <div className="date-container">
                    <div>

                    </div>
                </div>
                <div className="weather-conditions">
                    {this.props.weatherData.error && <div>{this.props.weatherData.error}</div>}
                    <div>
                        {this.props.weatherData.city || 'Kiev'}
                    </div>
                    <div>
                        {this.props.weatherData.temperature} Â°C
                    </div>
                    <div>
                        Wind: {this.props.weatherData.wind} km/h
                        </div>
                    <div>
                        Pressure: {this.props.weatherData.pressure} MB
                        </div>
                    <div>
                        Humodity: {this.props.weatherData.humidity} %
                        </div>
                </div>
                <div>
                    <div>Sunrise: {this.props.weatherData.sunrise}</div>
                    <div>Sunset: {this.props.weatherData.sunset}</div>
                </div>
            </div>
        );
    }
}

export default WeatherContainer;
